import urllib.parse as parse

def paperDecode(encrystr):
    result = ''
    # print(encrystr)
    temp = parse.unquote(encrystr)
    # print(temp)
    temp = temp.replace('%','\\')
    temp = temp.encode('UTF-8').decode('unicode_escape')

    # 反转字符串，拿到正确的结果
    for i in range(0,len(temp)):
        result += temp[len(temp)-1-i]
    # print(result)
    return result

